	position: relative;
	z-index: 1;
	padding: 0px;
	margin: 0px;
	font-size: 1px;
	overflow: hidden;
	border: none;
	height: 100%;
	width: 6px;
	top: 0;
	cursor: col-resize;

	background: #e0e0e0 url('@assets/ui/erp/sidebar.png');
	&.left {
		right: 0;
		&.close {
			left: 1px !important;
			& > div {
				&::after {
					transform: rotate(180deg);
					-webkit-transform: rotate(180deg);
					-moz-transform: rotate(180deg);
					-ms-transform: rotate(180deg);
					-o-transform: rotate(180deg);
				}
			}
		}
	}
	&.right {
		// right: 400px;
		&.close {
			right: 0 !important;
		}
	}
	&.bottom {
		height: 6px;
		width: 100%;
		cursor: row-resize !important;
		& > div {
			transform: translate(-50%, 0) rotate(90deg);
			left: 50%;
		}
		&.close {
			bottom: 3px !important;
		}
	}
	&.top {
		display: none;
		background: none;
		background: #d1d1d1 url('@assets/ui/erp/sidebar.png');
		height: 11px;
		width: 100%;
		cursor: row-resize !important;
		& > div {
			transform: translate(-50%, 0) rotate(90deg);
			left: 50%;
		}
		&.close {
			bottom: 3px !important;
		}
	}
	@media screen and(max-width:1050px) {
		&.top {
			display: block;
		}
		
	}
	& > div {
		position: absolute;
		padding: 0px;
		margin-top: -25px;
		overflow: hidden;
		cursor: pointer;
		z-index: 1;
		height: 50px;
		width: 6px;
		top: 50%;
		background: #eee;
		border: 1px solid #796c6c;
		box-sizing: border-box;
		&:after {
			position: absolute;
			border-right: 4px solid #796c6c;
			border-top: 4px solid transparent;
			border-bottom: 4px solid transparent;
			top: 20px;
			left: 0;
			content: '';
		}
		&.toggle-close-icon:after {
			position: absolute;
			border-right: none;
			border-left: 4px solid #796c6c;
			border-top: 4px solid transparent;
			border-bottom: 4px solid transparent;
			top: 20px;
			left: 0;
			content: '';
		}
	}
	&.dragging,
	&.close,
	&:hover {
		visibility: visible;
		background: #d1d1d1 url('@assets/ui/erp/sidebar.png');
	}

	&.right > div::after,
	&.bottom > div::after,
	&.bottom-right > div::after {
		transform: rotate(180deg);
		-webkit-transform: rotate(180deg);
		-moz-transform: rotate(180deg);
		-ms-transform: rotate(180deg);
		-o-transform: rotate(180deg);
	}
	&.right.close > div::after,
	&.bottom.close > div::after,
	&.bottom-right.close > div::after {
		transform: rotate(360deg);
		-webkit-transform: rotate(360deg);
		-moz-transform: rotate(360deg);
		-ms-transform: rotate(360deg);
		-o-transform: rotate(360deg);
	}
	&:hover > div,
	&.close > div {
		display: block;
	}
}

.div {
	display: flex;
}
.toggletop {
	flex-direction: column-reverse;
	height: 100% !important;
}

.top-toggle {
	display: none !important;
}
.layout-toggler-box {
	display: flex;
	.open {
		display: block;
	}
	.close {
		display: none;
	}
	.layout-toggler-container {
		overflow: auto;
		// overflow: hidden;
		-webkit-overflow-scrolling: touch;
		flex: 1;
	}
	.layout-toggler-control {
		position: relative;
		.mirror {
			position: absolute;
			z-index: 10;
			&:active {
				background-color: red;
			}
		}
	}
	
	@media screen and(max-width:1050px){
		.layout-toggler-control-WELDING-TOOLS-left {
			display: none;
		}
		
	}
}
.left {
	flex-direction: row;
}
.bottom {

.tab {
	width: 100%;
	height: 100%;
	border-left: 1px solid #dcdcdc;
	border-bottom: none;
	padding-top: 2 * @setRemPx;

	font-size: 10px;

	.tab_button_normal {
	}
	.tab_button_selected {
		width: 80%;
		height: 8 * @setRemPx;

		border: 1px solid #e0e0e0;
		border-left: none;
		background-color: #fff;
		display: flex;
		justify-content: center;
		align-items: center;

		.tab_button_selected_text {
			width: 100%;
			height: 100%;

			display: flex;
			justify-content: center;
			align-items: center;

			color: #3c9bff;

			line-height: 1.2 * @setRemPx;
			font-size: 1.2 * @setRemPx;
			font-weight: bold;

			text-align: center;
		}
	}
}
.comboBox_panel {
	width: 100%;
	height: 100%;

	.comboBox_container {
		display: flex;
		flex-direction: column;
		justify-content: flex-start;
		align-items: center;
		padding-right: 2.4 * @setRemPx;

		.comboBox_list {
			display: flex;
			flex-direction: column;
			justify-content: flex-start;
			align-items: center;
			width: 100%;

			&:first-child {
				margin-top: 0.6 * @setRemPx;
			}
		}
	}
}

	display: flex;
	flex-direction: column;
}
.smt-preview-header {
	height: 32px;
	display: flex;
	justify-content: space-between;
	.smt-preview-header-left {
		position: relative;
		z-index: 3;
		margin-left: 6px;
		background-color: white;
		display: flex;
		align-items: center;
		.open-editor {
			width: 130px;
			height: 24px;
			line-height: 24px;
			padding: 0 5px;
			margin-right: 6px;
			color: #3399ff;
			font-size: 12px;
			white-space: nowrap;
			border: 1px solid #3399ff;
			border-radius: 3px;
			box-sizing: border-box;
			cursor: pointer;
			display: flex;
			align-items: center;
			img {
				margin-right: 5px;
			}
			&:hover {
				background-color: #e6f7ff;
			}
		}
	}
	.smt-preview-header-center {
		.device-visible-switch {
			line-height: 32px;
			margin-left: 12px;
		}
	}
	.smt-preview-header-right {
		display: flex;
		flex-direction: row;
		text-align: center;
		align-items: center;
		margin-right: 6px;
		.layer-switch {
			margin-left: 30px;
		}
	}
}

.order-title-wrap {
	position: absolute;
	z-index: 2;
	width: 100%;
	height: 32px;
	display: flex;
	justify-content: center;
	.order-title {
		font-size: 16px;
		font-weight: 600;
		// \u8BBE\u7F6E\u6587\u672C\u80FD\u591F\u88AB\u9009\u4E2D\uFF0C\u4EE5\u4FBF\u901A\u8FC7 execCommand('copy') \u590D\u5236\u6587\u672C
		user-select: text;
		cursor: pointer;
		line-height: 32px;
		max-width: calc(100% - 950px);
		white-space: nowrap;
		overflow: hidden;
		text-overflow: ellipsis;
		// #order-id {
		// 	cursor: pointer;
		// }
	}
}

@media screen and (max-width: 1350px) {
	.order-title-wrap {
		width: calc(100% - 475px);
		right: 0;
		.order-title {
			max-width: 95%;
		}
	}
}

// @media screen and (max-width: 860px) {
// 	.order-title-wrap {
// 		position: static;
// 		width: auto;
// 		.order-title {
// 			max-width: 95%;
// 		}
// 	}
// }

@media screen and (max-width: 700px) {
	.header-media-query {
		// \u6362\u4E2A\u7C7B\u540D\uFF0C\u9694\u79BB\u5BF9 GERBER-RO \u9879\u76EE\u7684\u5F71\u54CD
		height: 64px;
		display: flex;
		justify-content: space-between;
		.smt-preview-header-left {
			margin-left: 6px;
			background-color: white;
		}
		.smt-preview-header-right {
			height: 32px;
			display: flex;
			flex-direction: row;
			text-align: center;
			align-items: center;
			// margin-right: 8px;
		}
	}
	.smt-preview-header-center {
		position: absolute;
		// margin-left: 60px;
		padding-top: 32px;
		.device-visible-switch {
			line-height: 32px;
			margin-left: 20px;
		}
	}
}

.smt-preview-header-nav-bar {
	height: 32px;
	width: 100%;
	display: flex;
	flex-wrap: nowrap;
	align-items: center;
	.disable {
		user-select: none;
		filter: invert(79%) sepia(11%) saturate(23%) hue-rotate(102deg) brightness(96%) contrast(80%);
		pointer-events: none;
	}
	.nav-bar-item {
		display: inline-block;
		margin: 0 6px;

		cursor: pointer;
	}

	.undo-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-undo.svg') center center no-repeat;
	}
	.redo-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-redo.svg') center center no-repeat;
	}
	.driver {
		height: 20px;
		width: 0;
		margin: 0 10px;
		border-right: 1px solid #d9d9d9;
	}

	.adapt-window-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-view-fit-board-outline.svg') center center no-repeat;
	}

	.measure-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-measure.svg') center center no-repeat;
	}

	.home-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/home_icon_16px.svg') center center no-repeat;
	}

	.setting-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-setting.svg') center center no-repeat;
	}

	.unfold-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-unfold-view.svg') center center no-repeat;
	}

	.fold-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-fold-view.svg') center center no-repeat;
	}

	.full-screen {
		height: 16px;
		width: 16px;
	}

	.back-to-pro-eda-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-update-to-pcb.svg') center center no-repeat;
	}
	.zoom-in-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-zoom-in.svg') center center no-repeat;
	}
	.zoom-out-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-zoom-out.svg') center center no-repeat;
	}
	.adapt-select-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-view-fit-selection.svg') center center no-repeat;
	}
	.align-auto-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-auto-align.svg') center center no-repeat;
	}
	.reverse-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-flip-board.svg') center center no-repeat;
	}
	.overall-counter-clockwise-rotation-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-rotate-left.svg') center center no-repeat;
	}
	.overall-clockwise-rotation-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-rotate-right.svg') center center no-repeat;
	}
	.independent-counter-clockwise-rotation-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-rotate-by-reference.svg') center center no-repeat;
	}
	.independent-clockwise-rotation-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-smt-rotate-clockwise.svg') center center no-repeat;
	}
	.screen-shot-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-smt-image-export.svg') center center no-repeat;
	}
	.dfm-check-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-check-dfm.svg') center center no-repeat;
	}
	.export-bom-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-bom.svg') center center no-repeat;
	}
	.export-3d-icon {
		height: 16px;
		width: 16px;
		background: url('@/assets/ui/erp/icon_svg/eda-export-3d.svg') center center no-repeat;
	}
	.angle-select {
		height: 16px;
		width: 26px;
		margin-right: 12px;
		margin-bottom: 4px;
		// input {
		// 	font-size: 12px;
		// 	font-family: 'Microsoft Yahei';
		// 	-moz-appearance: textfield;
		// 	border: 1px solid #d9d9d9;
		// 	padding: 3px;
		// 	height: 20px;
		// 	width: 30px;
		// 	color: #333;
		// 	box-sizing: border-box;
		// 	box-shadow: none;
		// 	border: 1px solid #d9d9d9;
		// 	&:hover {
		// 		cursor: text;
		// 	}
		// 	&:focus-visible {
		// 		outline: none;
		// 		border: 1px solid #1890ff;
		// 	}
		// }
	}
}
.smt-preview-header-nav-bar-welding {
	// display: flex !important;
	display: none;
	flex-direction: column;
	text-align: left;
	width: 60px;
	position: absolute;
	z-index: 5;
	bottom: 80px;
	li {
		background-color: rgba(255, 255, 255, 0.8);
		text-align: center;
		border-radius: 50%;
		margin-bottom: 10px !important;
		width: 40px;
		height: 40px !important;
		i {
			margin-left: 5px;
			margin-bottom: 6px;
			margin-top: 5px;
			height: 28px !important;
			width: 28px !important;
			background-size: cover !important;
		}
	}
}
@media screen and(max-width:1050px) {
	.smt-preview-header-nav-bar-welding {
		display: flex;
	}
}

@media screen and(max-width:1050px) {
	.icon {
		display: block;
		background-repeat: no-repeat;
		.can-hover&:hover {
			filter: none !important;
		}
	}
}
.icon {
	display: block;
	background-repeat: no-repeat;
	.can-hover&:hover {
		filter: invert(42%) sepia(93%) saturate(1773%) hue-rotate(186deg) brightness(102%) contrast(105%);
	}
}

.active {
	filter: invert(42%) sepia(93%) saturate(1773%) hue-rotate(186deg) brightness(102%) contrast(105%);
}

/** PCB \u786E\u8BA4\u7A3F\u6FC0\u6D3B\u6837\u5F0F */
.active-pcb {
	filter: invert(42%) sepia(93%) saturate(1773%) hue-rotate(186deg) brightness(102%) contrast(105%);
	border: 1px solid #3399ff;
	border-radius: 2px;
	padding: 3px;
	margin-left: 2px !important;
	margin-right: 2px !important;
}

.shortcut-board {
	width: 800px;
}

.system-board {
	width: 800px;
}

.recover-info-modal {
	width: 400px;
}
.recover-info-modal p {
	margin-bottom: 16px;
}

.setting-container {
	height: 330px;
	// border: 1px #d9d9d9 solid;
	// border-right: none;
}

.system-container {
	position: relative;
}

.system-container-menu-container {
	position: absolute;
	width: 140px;
	height: 334px;
	border: 1px #d9d9d9 solid;
}

// .system-container-menu:hover {
// 	background-color: #e6f7ff;
// }

.system-container-menu p {
	margin-left: 16px;
}

.system-container-menu-active {
	background-color: #e6f7ff;
	color: #3399ff;
}

.system-container-menu-system {
	margin-bottom: 10px;
	cursor: pointer;
}

.system-container-menu-system:hover {
	background-color: #e6f7ff;
}

.system-container-menu-sck {
	margin-bottom: 10px;
	cursor: pointer;
}

.system-container-menu-sck:hover {
	background-color: #e6f7ff;
}

.system-components-container {
	position: absolute;
	left: 170px;
}

.first {
	width: 500px;
	display: flex;
	align-items: center;
	justify-content: space-around;
}

.first,
.second,
.third,
.fourth {
	margin-bottom: 16px;
}

// .second {
// 	display: flex;
// 	align-items: center;
// 	justify-content: center;
// }
.second {
	margin-left: 26px;
}

.second-one {
	margin-left: 50px;
}

.second-two,
.second-three {
	margin-left: 134px;
	margin-top: 16px;
}

.third,
.fourth {
	margin-left: 26px;
}

.third input,
.fourth input {
	margin-left: 84px;
}

.smt-viewModel {
	display: flex;
	justify-content: space-between;
	align-items: center;
	font-size: 14px;
	.radioArea {
		flex: 1;
		display: flex;
		justify-content: space-between;
		align-items: center;
	}
}

.showDialogIcon {
	-webkit-tap-highlight-color: transparent;
	cursor: pointer;

	margin-right: 10px;
	text-align: right;
}
.dialog_panel {
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	height: 10rem;
	position: absolute;
	right: 10px;
	top: calc(2.5rem + 2px);
	z-index: 99;
	background: white;
	box-shadow: 0 0 2px 2px rgba(0, 0, 0, 0.1);
}
.radioArea_column {
	flex: 1;
	display: flex;
	flex-direction: column;
	justify-content: space-around;
	align-items: flex-start;
	padding: 1rem;
}

.radioArea_item {
	display: flex;
	flex-direction: row;
	justify-content: flex-start;
	align-items: center;
}

.weld_phone_header {
	display: flex;
	justify-content: space-between;
	align-items: center;
	height: 2.5rem;
	width: 100%;
}
.weld_phone_icon {
	display: flex;
	justify-content: center;
	align-items: center;
	height: 2.5rem;
	width: 2.5rem;
	padding-left: 1rem;
}
.weld_phone_icon_image {
	display: flex;
	justify-content: center;
	align-items: center;
	width: 100%;
	height: 100%;
}
.weld_phone_name_panel {
	display: flex;
	justify-content: flex-start;
	align-items: center;
	width: calc(100% - 6rem);
	height: 2.5rem;
	padding-left: 1rem;
}
.weld_phone_name {
	width: calc(100% - 1rem);
	height: 100%;

	text-align: left;

	line-height: 2.5rem;
	font-weight: bold;
	font-size: 1.2rem;
	color: #333;
	white-space: nowrap;
	text-overflow: ellipsis;
	overflow: hidden;
}
.weld_phone_hamburger {
	display: flex;
	justify-content: center;
	align-items: center;
	height: 2.5rem;

	height: 24px;
	position: relative;
	display: inline-block;
	white-space: nowrap;
	text-align: center;
	vertical-align: middle;
	background-image: none;
	outline: none;
	padding: 0 8px;
	font-size: 12px;
	cursor: pointer;
	border-radius: 2px;
}
.eda-btn-default {
	color: #3399ff;
	background-color: #ffffff;
	border: 1px #d9d9d9 solid;
	&:hover {
		border-color: #3399ff;
	}
	&:active {
		background-color: #e3f7ff;
	}
	&.disable {
		color: #bfbfbf;
		border-color: #d9d9d9;
		background-color: #f1f1f1;
		cursor: no-drop;
	}
}

.eda-btn-stress {
	color: #ffffff;
	background-color: #3399ff;
	border: 1px solid #3399ff;
	&:hover {
		background-color: #41a9ff;
	}
	&:active {
		background-color: #0066ff;
	}
	&.disable {
		border-color: #d9d9d9;
		background-color: #d9d9d9;
		cursor: no-drop;
	}
	&:focus-visible {
		box-shadow: 0 0 10px 2px #3399ff;
	}
}

.eda-btn-extension {
	color: #3399ff;
	background-color: #ffffff;
	border: 1px solid #3399ff;
	&:hover {
		background-color: #e6f7ff;
	}
	&:active {
		color: #ffffff;
		background-color: #3399ff;
	}
	&.disable {
		border-color: #d9d9d9;
		color: #bfbfbf;
		background-color: #ffffff;
		cursor: no-drop;
	}
}

.eda-btn-danger {
	color: #ffffff;
	background-color: #fd4f54;
	border: 1px solid #fd4f54;
	&:hover {
		background-color: #fd7978;
		border: 1px solid #fd7978;
	}
	&:active {
		background-color: #d73843;
		border: 1px solid #d73843;
	}
	&.disable {
		border-color: #d9d9d9;
		color: #bfbfbf;
		background-color: #ffffff;
		cursor: no-drop;
	}
}

.eda-btn-sm {
	box-sizing: border-box;
	width: 56px;
	height: 24px;
}

	position: fixed !important;
	top: 50%;
	left: 50%;
	min-width: 300px;
	z-index: 2000;
	background-color: #fff;
	border-radius: 2px;
	border: 1px solid #d1d1d1;
	box-shadow: 0px 0px 12px 2px rgba(0, 0, 0, 0.4);
	transform: translate(-50%, calc(-50% - 30px));
	opacity: 1;
	visibility: hidden;
	// transition: 0.24s;

	// animation: eda-modal-hidden .2s forwards;
	.eda-modal-container {
		display: flex;
		border-radius: 2px;
		flex-direction: column;
		height: 100%;
		width: 100%;
		.eda-modal-header {
			position: relative;
			color: rgba(0, 0, 0, 0.85);
			background: #fff;
			border-radius: 2px 2px 0 0;
			padding: 0 20px;
			height: 28px;
			line-height: 28px;
			background-color: #f1f1f1;
			display: flex;
			align-items: center;
			.eda-modal-title {
				font-size: 12px;
				color: #303133;
				flex: 1;
			}
			.eda-icon-close {
				filter: invert(68%) sepia(0%) saturate(3%) hue-rotate(321deg) brightness(90%) contrast(93%);
				background-image: url('@assets/ui/erp/icon_svg/eda-x.svg');
				background-repeat: no-repeat;
				width: 24px;
				height: 24px;
				cursor: pointer;
				position: relative;
				text-align: center;
				left: 6px;
				background-size: 24px 24px;
				cursor: pointer;
				text-align: center;
				line-height: 28px;

				&:hover {
					filter: invert(52%) sepia(11%) saturate(2798%) hue-rotate(171deg) brightness(113%) contrast(107%);
				}
			}
		}
		.eda-modal-body {
			margin-top: 16px;
			flex: 1;
			font-size: 12px;
			// height: auto;
			min-height: 100px;
			box-sizing: content-box;
			padding: 0px 16px 16px 16px;
			&.flex {
				display: flex;
			}
			.icon {
				padding-right: 4px;
				transform: translateY(-1px);
				img {
					width: 20px;
					height: 20px;
				}
			}
		}

		.eda-message-box__btns {
			display: flex;
			flex-direction: row-reverse;
			padding: 0px 16px 16px;
			text-align: right;
		}
		.modal-btn {
			height: 28px;
			width: fit-content;
			margin-left: 8px;
			padding: 0 16px;
			font-size: 12px;
			box-sizing: border-box;
		}
	}
}

.eda-modal-top {
	top: 20%;
	width: 400px;
}

.eda-show {
	visibility: visible;
	opacity: 1;
	transform: translate(-50%, -50%);
	// animation: eda-modal-show .2s forwards;
}
.confirmDisable {
	background-color: #d9d9d9;
	cursor: not-allowed;
	border: 1px solid #d9d9d9;
	&:hover {
		background: #d9d9d9;
	}
}

.modal-btn-cancel-disabled {
	background-color: #d9d9d9;
	cursor: not-allowed;
	border: 1px solid #d9d9d9;
	color: #fff;
	&:hover {
		background: #d9d9d9;
		border-color: #d9d9d9;
	}
}

.confirmLoading {
	position: relative;
	background-color: #41a9ff;
	border-color: #41a9ff;
	&:hover {
		background-color: #41a9ff;
	}
}

.modal-btn-loading-span {
	position: absolute;
	left: 10px;
	display: inline-block;
	width: 18px;
	height: 18px;
	animation: rotation 1.4s linear infinite;
	background-image: url('@/assets/ui/jlcpcb/eda-loading.svg');

	background-repeat: no-repeat;
	filter: invert(85%) sepia(98%) saturate(16%) hue-rotate(259deg) brightness(105%) contrast(105%);
}

@keyframes rotation {
	0% {
		transform: rotate(0deg);
	}
	100% {
		transform: rotate(360deg);
	}
}

@keyframes eda-overlay-show {
	0% {
		opacity: 0;
	}
	100% {
		opacity: 1;
	}
}
@keyframes eda-overlay-hidden {
	0% {
		opacity: 0;
	}
	100% {
		opacity: 1;
	}
}

@keyframes eda-modal-show {
	0% {
		opacity: 0;
		transform: translateX(-50%) translateY(calc(-50% - 40px));
		visibility: hidden;
	}
	100% {
		opacity: 1;
		transform: translateX(-50%) translateY(-50%);
		visibility: visible;
	}
}
@keyframes eda-modal-hidden {
	0% {
		opacity: 1;
		transform: translateX(-50%) translateY(-50%);
		visibility: visible;
	}
	100% {
		transform: translateX(-50%) translateY(calc(-50% - 40px));
		opacity: 0;
		visibility: hidden;
	}
}

.eda-show.eda-effect-16 ~ .container {
	filter: blur(3px);
}

* {
	padding: 0;
	margin: 0;
}
html,
body {
	margin: 0;
	//font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'Roboto', 'Oxygen', 'Ubuntu', 'Cantarell', 'Fira Sans', 'Droid Sans', 'Helvetica Neue', sans-serif;
	font-family: 'Roboto', sans-serif;
	-webkit-font-smoothing: antialiased;
	-moz-osx-font-smoothing: grayscale;
	height: 100%;
	// filter: invert(1);
}

code {
	font-family: source-code-pro, Menlo, Monaco, Consolas, 'Courier New', monospace;
}
div {
	font-family: 'Roboto', sans-serif;
}

.smt-ui-container {
	padding: 0;
	margin: 0;
	-webkit-font-smoothing: antialiased;
	-moz-osx-font-smoothing: grayscale;
	height: 100%;
	width: 100%;
	overflow: hidden;
	position: relative;
	font-family: sans-serif;
	font-size: 12px;
	// display: flex;
	// flex-flow: column;
	user-select: none;
	table {
		// width: 878px;
		font-size: 13px;
		border-collapse: collapse; //\u8FB9\u6846\u4F1A\u5408\u5E76\u4E3A\u4E00\u4E2A\u5355\u4E00\u7684\u8FB9\u6846\u3002\u4F1A\u5FFD\u7565 border-spacing \u548C empty-cells \u5C5E\u6027\u3002
		width: 100%;
		table-layout: fixed;
	}
	thead th {
		text-align: left;
		height: 22px;
		background-color: #f2f2f2;
		line-height: 15px;
		border: 1px solid #cbcbcb;
		padding-left: 10px;
		padding-right: 10px;
		img {
			height: 13px;
			width: 13px;
			float: right;
		}
		img:hover {
			cursor: pointer;
		}
	}
}
li {
	list-style: none;
}
